import React, {Component} from 'react'
import { Layout, Tabs,  Breadcrumb} from "antd"
import {withRouter} from "react-router-dom"
import SupervisedTable from './components/SupervisedTable'
import DataAnalyticsRow from './components/DataAnalytics'
const {Content} = Layout;
const {BreadcrumbItem} = Breadcrumb;

class Customer extends Component{
    componentDidMount () {

        localStorage.setItem('route', this.props.location.pathname);

      };
    render(){
        return(
            <Layout>
                <Content>
                <h3>Customer</h3>
                <DataAnalyticsRow/>
            <SupervisedTable/>
                </Content>
            </Layout>

        )
    }
}
export default withRouter(Customer);
